import React, { createContext,useState } from 'react';
import blackNike from '../Assests/BlackNike.jpg';
import blueSimple from '../Assests/BlueSimple.jpg';
import cutShoes from '../Assests/CutShoes.jpg';
import grayShoes  from '../Assests/GrayShoes.jpg';
import leatherShoe from '../Assests/LeatherShoe.jpg';
import loveJoggers from '../Assests/LoveJoggers.jpg';
import menSportsShoes from '../Assests/MenSportsShoes.jpg';
import multicolorNike from '../Assests/MulticolorNike.jpg';
import rainbowSports from '../Assests/RainbowSports.jpg';
import whiteNike from '../Assests/MenWhiteNike.jpg'
const ProductsContext = createContext();

export const ProductsContextProvider = (props) => {
    const [products] = useState([
       {id: 1, name: 'Black Nike', price: 6000, image:blackNike},
       {id: 2, name: 'Blue Simple Shoe', price: 6000, image:blueSimple},
       {id: 3, name: 'Cut Shoes', price: 6000, image:cutShoes},
       {id: 4, name: 'Gray style Shoe', price: 6000, image:grayShoes},
       {id: 5, name: 'Leather Shoe', price: 6000, image:leatherShoe},
       {id: 6, name: 'Love Joggers', price: 6000, image:loveJoggers},
       {id: 7, name: 'Sports Men', price: 6000, image:menSportsShoes},
       {id: 8, name: 'Nike Multicolor Shoe', price: 6000, image:multicolorNike},
       {id: 9, name: 'Rainbow Sports Shoe', price: 6000, image:rainbowSports},
       {id: 10, name: 'Men White Nike', price: 6000, image:whiteNike},

    ])
    return (
       <ProductsContext.Provider value={{products: [...products]}}>
         {props.children}
       </ProductsContext.Provider>
    )
}


export default ProductsContextProvider;
